import React, { useContext, useState } from 'react';
import { UserContext } from './Context'; // ייבוא ה-UserContext
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Avatar from '@mui/material/Avatar';
import Tooltip from '@mui/material/Tooltip';
import Button from '@mui/material/Button';
import CottageIcon from '@mui/icons-material/Cottage';
import { useNavigate } from 'react-router-dom';
import Search from './Search';

const NavBar = () => {
  const { user, logout } = useContext(UserContext); // כאן אנחנו משתמשים ב-logout מה-context
  const navigate = useNavigate();
  const [anchorElUser, setAnchorElUser] = useState(null);

  const userpages = [
    { name: "כל המתכונים", route: 'home' },
    { name: "אודות", route: 'about' },
    { name: "התחברות", route: 'login' },
    { name: "הרשמה", route: 'signup' }
  ];

  const pages = user && user.isAdmin
    ? [
      { name: "כל המתכונים", route: 'home' },
      { name: "אודות", route: 'about' },
      { name: "התחברות", route: 'login' },
      { name: "הרשמה", route: 'signup' },
      { name: "הוספת קטגוריה", route: 'AddCategoryManager' },
      { name: "הוספת מתכון", route: 'AddRecipeManager' }
    ]
    : [
      { name: "כל המתכונים", route: 'home' },
      { name: "אודות", route: 'about' },
      { name: "התחברות", route: 'login' },
      { name: "הרשמה", route: 'signup' }
    ];

  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  const handleNavigate = (page) => {
    const route = `/${page.route}`;
    navigate(route);
    handleCloseUserMenu();
  };

  const handleLogout = () => {
    logout(); // קורא לפונקציה logout
    handleCloseUserMenu();
    navigate('/login'); // מפנה את המשתמש לעמוד ההתחברות אחרי ההתנתקות
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: '#dc4337', position: 'fixed', top: '0px', zIndex: 999 }}>
      <Box sx={{ flexGrow: 1 }}>
        <Toolbar disableGutters>
          {user && (
            <Box sx={{ flexGrow: 0 }}>
              <Tooltip title="Open settings">
                <IconButton onClick={handleOpenUserMenu} sx={{ p: 0 }}>
                  <Avatar alt={user.username} src="/static/images/avatar/2.jpg" />
                </IconButton>
              </Tooltip>
              <Menu
                sx={{ mt: '45px' }}
                anchorEl={anchorElUser}
                anchorOrigin={{
                  vertical: 'top',
                  horizontal: 'right',
                }}
                open={Boolean(anchorElUser)}
                onClose={handleCloseUserMenu}
              >
                {userpages.map((page, index) => (
                  <MenuItem key={index} onClick={() => handleNavigate(page)}>
                    <Typography textAlign="center">{page.name}</Typography>
                  </MenuItem>
                ))}
                <MenuItem onClick={handleLogout}>
                  <Typography textAlign="center">התנתקות</Typography>
                </MenuItem>
              </Menu>
            </Box>
          )}

          <Search />

          <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
            {pages.map((page, index) => (
              <Button
                key={index}
                onClick={() => handleNavigate(page)}
                sx={{ my: 2, color: 'white', display: 'block' }}
              >
                {page.name}
              </Button>
            ))}
          </Box>

          <CottageIcon sx={{ display: { xs: 'flex', md: 'none' }, mr: 1 }} />
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="#"
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            מתכונים
          </Typography>
        </Toolbar>
      </Box>
    </AppBar>
  );
};

export default NavBar;
